import { useState, useRef, useEffect } from "react";

const Tasks = ({ getTask }) => {
  return (
    <div className="tasks">
      {getTask.map((x, i) => (
        <div key={i} className="vienastask">
          <div>
            <h5>{x.date}</h5>
            <h2>{x.value}</h2>
          </div>
          <div className="buttons">
            <button> COMPLETED</button>
            <button>DELETE</button>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Tasks;
